import styled from "styled-components";
export const Conatainer=styled.div`
display: flex;
justify-content: space-between;
flex-direction: row;
padding: 30px 0px 34px;
`
export const LogoTitle=styled.div`
font-family: Rubik;
font-style: normal;
font-weight: 500;
font-size: 24px;
line-height: 28px;
color: #555555;
`
export const Logotip=styled.div`
display: flex;
flex-direction: row;
align-items: center;
`
